import React, { Component } from 'react'

class BindingEventHandling extends Component {

    constructor(){
        super()
        this.state={
            message:"Hello World"
        }
    }
    clickevent(){
        this.setState({
            message:"Good Bye!"
        })
    }

  render() {
    const {message}=this.state
    return (
      <div>
        <h1>{message}</h1>
        <button onClick={this.clickevent}> Click</button>
      </div>
    )
  }
}

export default BindingEventHandling
